import React, { Component } from 'react'
import { BrowserRouter as Router,Route,Switch} from 'react-router-dom'
import { LatestUpdate } from './LatestUpdate'
import CovidStats from './components/CovidStats'
import BrowseLearning from './components/BrowseLearning'
import LocationUpdates from './components/LocationUpdates'
import Login from './Login'
import { Layout } from './components/Layout'
import logo from './logo.svg';
import './App.css';
import { Container,Row,Col } from 'react-bootstrap';
import  LeftMenu  from './components/LeftMenu';

export default class Home extends Component{

    constructor(props){
        super(props);
    }

    render ()  {
        //const covid19ds = ;
     <React.Fragment>
      <Layout>
      <Container>
          <Row>
            <Col xs={2}>
              <LeftMenu callBackDataFromSelMenu={this.callBackToLoadDataSelFromLeftMenu}  />
            </Col>
            <Col>
            <Switch>
            <Home pageIdToShow={this.state.pageIdToShow}/>
            <Route exact path="/latest" component={LatestUpdate}/>
          </Switch>
          </Col>
          </Row>
        </Container>
      </Layout>
       </React.Fragment>
            if(this.props.pageIdToShow==1){
                return (<CovidStats/>)
            }else if(this.props.pageIdToShow==2){
                return (<BrowseLearning/>)
            }else{
                return (<LocationUpdates/>)
            }
    }
}
